// src/App.js
import React, { useState, useEffect } from "react";
import axios from "./api";
import "./App.css";

const App = () => {
	const [internalCapacity, setInternalCapacity] = useState("");
	const [batteryCapacity, setBatteryCapacity] = useState("");
	const [stationId, setStationId] = useState("");
	const [maxChargeRate, setMaxChargeRate] = useState("");
	const [vehicleId, setVehicleId] = useState("");
	const [soc, setSoc] = useState("");
	const [maxChargingRate, setMaxChargingRate] = useState("");
	const [vehicleBatteryCapacity, setVehicleBatteryCapacity] = useState("");
	const [desiredSoc, setDesiredSoc] = useState("");
	const [stations, setStations] = useState([]);
	const [systemData, setSystemData] = useState({});

	const fetchLoadDistribution = async () => {
		try {
			const response = await axios.get("/load_distribution");
			const data = response.data;
			const stationsData = data.filter((item) => item.station_id);
			const systemInfo = data.find((item) => !item.station_id);
			setStations(stationsData);
			setSystemData(systemInfo);
		} catch (error) {
			console.error("Error fetching load distribution:", error);
		}
	};

	useEffect(() => {
		fetchLoadDistribution();
	}, []);

	const handleConfigureSystem = async () => {
		try {
			await axios.post("/configure_system", {
				internal_capacity: internalCapacity,
				battery_capacity: batteryCapacity,
			});
			alert("System configuration updated successfully");
			fetchLoadDistribution();
		} catch (error) {
			console.error("Error configuring system:", error);
		}
	};

	const handleAddStation = async () => {
		try {
			await axios.post("/add_station", {
				station_id: stationId,
				max_charge_rate: maxChargeRate,
			});
			alert(`Station ${stationId} added successfully`);
			fetchLoadDistribution();
		} catch (error) {
			console.error("Error adding station:", error);
		}
	};

	const handleConnectVehicle = async () => {
		try {
			await axios.post("/connect_vehicle", {
				station_id: stationId,
				vehicle: {
					vehicle_id: vehicleId,
					soc,
					max_charging_rate: maxChargingRate,
					battery_capacity: vehicleBatteryCapacity,
					desired_soc: desiredSoc,
				},
			});
			alert(
				`Vehicle ${vehicleId} connected to station ${stationId} successfully`
			);
			fetchLoadDistribution();
		} catch (error) {
			console.error("Error connecting vehicle:", error);
		}
	};

	const handleDisconnectVehicle = async (stationId) => {
		try {
			await axios.post(`/disconnect_vehicle/${stationId}`);
			alert(
				`Vehicle disconnected from station ${stationId} successfully`
			);
			fetchLoadDistribution();
		} catch (error) {
			console.error("Error disconnecting vehicle:", error);
		}
	};

	return (
		<div className="App">
			<h1>EV Charging System</h1>

			<div className="section">
				<h2>Configure System</h2>
				<input
					type="number"
					placeholder="Internal Capacity"
					value={internalCapacity}
					onChange={(e) => setInternalCapacity(e.target.value)}
				/>
				<input
					type="number"
					placeholder="Battery Capacity"
					value={batteryCapacity}
					onChange={(e) => setBatteryCapacity(e.target.value)}
				/>
				<button onClick={handleConfigureSystem}>Configure</button>
			</div>

			<div className="section">
				<h2>Add Station</h2>
				<input
					type="text"
					placeholder="Station ID"
					value={stationId}
					onChange={(e) => setStationId(e.target.value)}
				/>
				<input
					type="number"
					placeholder="Max Charge Rate"
					value={maxChargeRate}
					onChange={(e) => setMaxChargeRate(e.target.value)}
				/>
				<button onClick={handleAddStation}>Add Station</button>
			</div>

			<div className="section">
				<h2>Connect Vehicle</h2>
				<input
					type="text"
					placeholder="Vehicle ID"
					value={vehicleId}
					onChange={(e) => setVehicleId(e.target.value)}
				/>
				<input
					type="number"
					placeholder="State of Charge"
					value={soc}
					onChange={(e) => setSoc(e.target.value)}
				/>
				<input
					type="number"
					placeholder="Max Charging Rate"
					value={maxChargingRate}
					onChange={(e) => setMaxChargingRate(e.target.value)}
				/>
				<input
					type="number"
					placeholder="Battery Capacity"
					value={vehicleBatteryCapacity}
					onChange={(e) => setVehicleBatteryCapacity(e.target.value)}
				/>
				<input
					type="number"
					placeholder="Desired SOC"
					value={desiredSoc}
					onChange={(e) => setDesiredSoc(e.target.value)}
				/>
				<button onClick={handleConnectVehicle}>Connect Vehicle</button>
			</div>

			<div className="section">
				<h2>Stations</h2>
				<ul>
					{stations.map((station) => (
						<li key={station.station_id}>
							{station.station_id} - Max Feasible Rate:{" "}
							{station.max_feasible_rate}
							{station.vehicle_soc && (
								<>
									<br />
									Vehicle SOC: {station.vehicle_soc}% (Max
									Charging Rate:{" "}
									{station.vehicle_max_charging_rate})
									<button
										onClick={() =>
											handleDisconnectVehicle(
												station.station_id
											)
										}
									>
										Disconnect Vehicle
									</button>
								</>
							)}
						</li>
					))}
				</ul>
			</div>

			<div className="section">
				<h2>System Information</h2>
				<p>Internal Capacity: {systemData.internal_capacity}</p>
				<p>Battery Capacity: {systemData.battery_capacity}</p>
				<p>
					Battery Capacity Diverted:{" "}
					{systemData.battery_capacity_diverted}
				</p>
				<p>
					Battery Capacity Available:{" "}
					{systemData.battery_capacity_available}
				</p>
				<p>Building Load: {systemData.building_load}</p>
				<p>Available Capacity: {systemData.available_capacity}</p>
				<p>Capacity Utilization: {systemData.capacity_utilization}</p>
			</div>
		</div>
	);
};

export default App;
